import React, { Component } from 'react'

export default class App extends Component {
    static = {
        user: [
            {id:101, name:'Lathesh', password: 1234},
            {id:102, name:'Manju', password: 12345},
            {id:103, name:'Navin', password: 123456}
        ],
        isLoggedIn:false
    }
    render() {

        return (
            <div>
                <h1>{this.state.user}</h1>
            </div>
        )
           
   
            
    
        
                     
    }
}
